import Layout from '../components/MyLayout';

const Content = () => {
  const router = useRouter();
  return (
    <div>
      <h1>{router.query.title}</h1>
      <p>This is post page</p>
    </div>
  );
};

const Page = () => {
  const router = useRouter();

  return (
    <Layout>
      <Content />
    </Layout>
  );
};

export default Page;
